;‏ ‏ ‏ ‎‏ ‏ ‏ ‎‏ ‏ ‏ ‏ ‎‏ ‏ رفع النجم جوني ديب البالغ من العمر 55 عاما دعوى قضائية ضد طليقته آمبر بسبب مقال كتبته لصحيفة washington post في ديسمبر عام 2018 عن تعرضها للعنف المنزلي . ووفقا للدعوى القضائية فإن الممثلة الأمريكية كتبت مقالها كشخصية عامة تعرضت للعنف المنزلي ولم تذكر اسم جوني ديب بالتحديد ‏ ‏ ‏ ‏ ‎‏ ‏ ‏ ‎‏ ‏ ‏ ‏ ووصفها جوني بالكاذبة وأنها مجرد خدعة متقنة من آمبر لكسب التعاطف معها ولتحقيق تقدم في مسيرتها المهنية حيث قال جوني ديب '' هيرد ليست ضحية للعنف المنزلي بل مجرمة '' مدعياً أن الممثلة الأمريكية هي التي اعتدت عليه . ‏ ‎‏ ‏ ‏ ‏ ‎‏ ‏ ‏ ‎‏ ‏ ‏ ‏ ‏ ‏ ويقول جوني ديب إن المقال قد أثار ضررا في حياته المهنية، مدعيا أنه بعد مرور 4 أيام فقط على نشر المقال تم استبعاده من pirates caribbean، وأصبحت هي محبوبة من قبل حركة ‏ ‏ ‏ ‏ ‎‏ ‏ ‏ ‏ ‏ ‏ ‏ وانا اقوووول ليش تم استبعاد جووني من سلسلة الكاريبي طلعت هالحية 🐍 ورا الموضوع 🙂💔 حاليا يحاول ان ياخذ تعويض قدره ٥٠ مليون على الاضرار اللي سببتها هيرد بسمعته ‏ ‏ ‎‏ ‏ ‏ ‏ ‏ ‏ ‏ مايستاهل جوني 😢💔 ;[('\u200f', 'JJ'), ('\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200e\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200e\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200f', 'NNP'), ('\u200e\u200f', 'NNP'), ('\u200f', 'NNP'), ('رفع', 'NNP'), ('النجم', 'NNP'), ('جوني', 'NNP'), ('ديب', 'NNP'), ('البالغ', 'NNP'), ('من', 'NNP'), ('العمر', 'VBD'), ('55', 'CD'), ('عاما', 'NNP'), ('دعوى', 'NNP'), ('قضائية', 'NNP'), ('ضد', 'NNP'), ('طليقته', 'NNP'), ('آمبر', 'NNP'), ('بسبب', 'NNP'), ('مقال', 'NNP'), ('كتبته', 'NNP'), ('لصحيفة', 'NNP'), ('washington', 'VBZ'), ('post', 'NN'), ('في', 'NNP'), ('ديسمبر', 'NNP'), ('عام', 'NNP'), ('2018', 'CD'), ('عن', 'NNP'), ('تعرضها', 'NNP'), ('للعنف', 'NNP'), ('المنزلي', 'NNP'), ('.', '.'), ('ووفقا', 'VB'), ('للدعوى', 'JJ'), ('القضائية', 'NNP'), ('فإن', 'NNP'), ('الممثلة', 'NNP'), ('الأمريكية', 'NNP'), ('كتبت', 'NNP'), ('مقالها', 'NNP'), ('كشخصية', 'NNP'), ('عامة', 'NNP'), ('تعرضت', 'NNP'), ('للعنف', 'NNP'), ('المنزلي', 'NNP'), ('ولم', 'NNP'), ('تذكر', 'NNP'), ('اسم', 'NNP'), ('جوني', 'NNP'), (